  false,\n\t\"url\": null,\n\t\"notes\": \"The presence of invasive species at Quivira
  NWR threatens many of the resources and habitats that the refuge is tasked with
  protecting. Both the wetlands and prairie habitats continue to be impacted by invasive
  plants. For example, the introduction of invasive tree species is primarily responsible
  for the conversion of short-grass prairie to forest. Efforts are ongoing to contain
  widespread species such as saltcedar (Tamarix sp.), honey locust (Gleditsia triacanthos),
  black locust (Robinia pseudoacacia), Siberian elm (Ulmus pumila), common reed (Phragmites
  sp.), and Russian olive (Elaeagnus angustifolia) that have formed dense monocultures
  on the refuge. The refuge is currently using an integrated approach of burning,
  grazing, and chemicals to combat these and other invasive plant infestations already
  known to exist on the refuge. An inventory of these and other invasive plants at
  Quivira NWR will improve strategic planning and increase the efficiency and effectiveness
  of invasive plant management operations already occurring on the refuge.As part
  of the pilot project, Utah State University was asked to conduct an inventory for
  targeted invasive non-native plants within portions of the refuge. While the purpose
  of the larger project is to develop a guide for conducting inventories on refuges,
  this inventory also provided valuable information to meet the invasive species management
  goals established at Quivira National Wildlife Refuge.\",\n\t\"owner_org\": \"4d7ad1cd-3641-420b-8116-e4082f49cd44\",\n\t\"extras\":
